// import logo from './logo.svg';
import './App.css';


import React, { useState } from 'react';

import './App.css'; // import the CSS file

function App() {
  const [selectedValue, setSelectedValue] = useState('');

  const handleChange = (event) => {
    setSelectedValue(event.target.value);
  };

  return (
    <div className='center-container'> {/* add a container div with center class */}
      <h1 className='center'>Select Number of Subjects</h1>
      <select value={selectedValue} onChange={handleChange} className='center-dropdown'> {/* add center-dropdown class */}
        <option value='' disabled>
          Select Number of Subjects
        </option>
        {[...Array(9)].map((_, i) => (
          <option key={i} value={i + 1}>
            {i + 1}
          </option>
        ))}
      </select>

    </div>
  );
}
export default App;
